import React from 'react';

import { Game } from './Game';
import { SudokuProvider } from './context/SudokuContext';

import './Sudoku.css';
import { Header } from './components/layout/Header';

export function SudokuGame() {
  return (
    <div className='sudoku_wrapper'>
      <Header/>
      <SudokuProvider>
        <Game />
      </SudokuProvider>
      <ul class="bg-bubbles">
        <li></li>
        <li></li>
        <li></li>
        <li></li>
        <li></li>
        <li></li>
        <li></li>
        <li></li>
        <li></li>
        <li></li>
      </ul>
    </div>
  );
}
